import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <MakeList />
    </div>
  );
}

function MakeList() {
  let newA = allCountryScores.sort((a, b) => a.name.localeCompare(b.name));
  return newA.map((element) => (
    <div>
      <h2>High Scores: {element.name}</h2>
      <ul>
        <li>High Scores: {element.scores[1]}</li>
      </ul>
    </div>
  ));
}

export default App;
